import React, {Component} from "react";
import { Link } from 'react-router-dom';
import Button from 'react-bootstrap/Button';

import logo from "../../sourse/images/new_лого.png";

import style from "./Header.module.css"
import {
    FORM_ROUTE,
    HOME_ROUTE,
    FEEDBACK_ROUTE,
    AUTHORISATION_ROUTE,
    ERROR_ROUTE
} from "../../utils/consts";

export default class Header extends Component {

    render() {
        return (
            <header>
                <Link to={HOME_ROUTE}>
                    <img src={logo} className={style.navigation} alt={style.navigation}/>
                </Link>
                <nav className={style.navigation}>
                    <Link to={HOME_ROUTE}>Home</Link>
                    <Link to={FORM_ROUTE}>Form</Link>
                    <Link to={ERROR_ROUTE}>Services</Link>
                    <Link to={FEEDBACK_ROUTE}>Feedback</Link>
                </nav>
                <div>
                    <Button variant="light" className={'m-2'}>Light</Button>{' '}
                    <Button variant="dark" className={'m-3'}>Dark</Button>
                    <Link to={AUTHORISATION_ROUTE}>
                        <button>Login</button>
                    </Link>
                </div>


            </header>
        );
    }
}
